ven (E-200, E-202). Kann Spuren von andere Schalenfrüchte, Milch und Ei enthalten, EMPINONADAS, Zutaten: Mandel, zucker Pinienkern (20%), Glukosesirup, wasser, Stabilisator (E-420) und Konservativen (E-200, E-202). Kann Spuren von andere Schalenfrüchte, Milch und Ei enthalten, MARZIPANMAKRONEN. Marzipan (80%), (Mandel, zucker, Glukosesirup, wasser, Stabilisator (E-420) und Konservativen (E-200, E-202) und Mandel (20%), Kann Spuren von andere Schalenfrüchte, Mitch und Ei enthalten.', 'https://static.openfoodfacts.org/images/products/088/744/312/5695/front_fr.4.400.jpg', '27', '2.1', '41', '40', '5.4', '12', '0', '0', '', '0');

